(526, '1649687745294539_1709596372637009', '1117708261642965', 'Trích nguyên văn ý thầy (Đông Nguyên có gì sai bổ sung nhé!):\n\nCái này làm từ từ:  tới 2 tuần sau nộp cũng đc!\nÝ thầy là làm cho cả các trường khác đó. khi trên face có ai làm gì làm gì cái thì search đc id face nó ở trường nào lớp nào. Cơ bản làm cho trường mình trước! ý thầy t copy nguyên vào trong file yeucau so sung.txt đó nhé.\nChắc phải sửa lại csdl bổ sung thêm 1 số thuộc tính. Nguyễn Thơ  bổ sung thêm nhé! k thì cuối tuần t đi bắc ninh về rồi cùng làm cũng đc! nhưng mà t thấy cũng ít nên c làm dần đi nhé :p\n.\n.\n.\n.\n.\n.\n.\n- Trong CSDL member (thuộc group) thì cần bổ sung các trường như cái file excel quản lý trong lớp đó như là: tên thật đầy đủ, id lớp, địa chỉ email, tạm trú tạm vắng, số điện thoại, quê quán, ngày sinh.\n Các trường này được người quản lý group tự tay nhập (Thầy bảo nếu mà nhập được bằng file exel thì tốt)\n- Admin, người quản lý, có thể search ra group nhóm cấp dưới mà mình quản lý khi gửi mail..\n- Admin có thêm chức năng là: search id facebook của 1 người bất kì sẽ hiện ra cái thông tin mà member có member đã nhập đó. (Chỉ admin có)\n- View profile thêm 1 số trường tùy ý để chỉ cụ thể người đó là ai ở đâu, sđt liên hệ, ...  1 số trường như member??\n- Người quản lý có thể xem danh sách group nhóm mà mình quản lý (nhóm này là nhóm user quản lý group)\n- Làm chức năng báo cáo thường kì (một nút để thành viên nhấn tự động lấy 1 số thông tin hoặc cho nhập tay: tình hình nhóm group face,số vi phạm trong tháng, thành viên tích cực, tiêu cực )từ thành viên -> người quản lý -> admin  \n (Tạo 1 bảng chức năng hoặc gửi mail như cái mail kia cũng đc (sinh ra đoạn mã tự động hoặc cho gõ để tạo form chung thôi))', '2016-01-11 08:55:05', '2016-01-11 08:55:06', 1, 57, '2016-10-02 03:06:44', '2016-10-02 03:06:44'),
