(558, '1649687745294539_1707517632844883', '1117708261642965', 'Chào Tường, Đông, Thơ\n\nCuối cùng thì đề tài về Quản lý đoàn viên trên Facebook cũng được duyệt. Nhưng thời hạn để hoàn thành lại quá gấp. Trong vòng 1 tuần tới về cơ bản ta sẽ phải hoàn thành toàn bộ. Chi phí cho 2 bạn sẽ là 10 triệu (sẽ nhận được sau khi nghiệm thu xong hoàn toàn)\n\nMình note lại một số yêu cầu hệ thống, các bạn cố gắng hoàn thành giúp mình nhé. \n\nPhân quyền: 3 cấp: \n\n- BCH Đoàn Học viện\n\n- BCH Liên chi đoàn\n\n- Cán bộ chi đoàn. \n\nQuyền sẽ được gán bởi Admin, cấp cho account và gắn liền với account facebook của người dùng. Mỗi quyền sẽ gắn với việc được quản lý các account mức dưới. \n\nNgười dùng có thể dùng điện thoại di động Android hoặc web. \n\nCác chức năng: \n\n- Đăng ký nhóm mình quản lý. Tự động thu thập thông tin về các account facebook trong group đó và lưu vào CSDL. \n\n- Tự động thu thập thông tin public trong thời gian một tuần khi người dùng có yêu cầu. \n\n- Gửi thông báo (các thông tin về công tác đoàn): Chuyển cho các account ngay dưới mình và các group mình quản lý.\n\n- Lập báo cáo thống kê về tình hình sử dụng mạng xã hội của người dùng thuộc nhóm mình quản lý trong 1 tháng. Cho phép gửi báo cáo cho cán bộ cấp trên. \n\n- Thống kê các báo cáo nhận được từ cấp dưới và nhắc nhở các cá nhân chưa báo cáo. Nên có thông báo thời hạn báo cáo thường xuyên trên trang chủ của người dùng. \n\n- Gửi báo cáo về các vấn đề bất thưởng phát sinh (sinh viên trong chi đoàn có vấn đề về tư tưởng, sức khỏe, đề nghị giúp đỡ, giám sát ...). \n\n-  Gửi các câu hỏi cho cán bộ đoàn cấp trên. \n\nTrước mắt chưa cần hoàn thiện một cách hoành tráng đâu. Cũng chưa cần đưa vấn đề phân tích quan điểm vào (thực ra nó cũng khó áp dụng). Hai bạn chỉ cần cho nó chạy được cái đã. Cần làm rõ điều gì thì nhắn lại luôn cho mình biết nhé. \n\nCố gắng đến thứ 5 này demo được không? \n\nNgoài ra, chụp lại giúp mình các ảnh giao diện, CSDL, các biểu đồ usecase, kịch bản, biểu đồ lớp và biểu đồ tuần tự, biểu đồ gói ... (cái này nếu bận quá thì nhờ thêm tên nào đó làm giúp - vì cũng chỉ là đưa vào quyển cho nó đủ nội dung thôi)\n\nGiúp mình với nhé. \n\nNguyễn Mạnh Sơn', '2016-01-04 10:47:11', '2016-01-04 12:28:53', 1, 57, '2016-10-02 03:06:44', '2016-10-02 03:06:44'),
(559, '1649687745294539_1707483296181650', '1117708261642965', 'Thầy sơn vừa gọi bảo làm cái wweb thử nghiệm trên group và bắt comment của aiddos. Sư dụng phân tích quan điểm của Việt :3 tính đicacs bạn trong tuần này phải xog. Và có lương mấy triệu j đấy thầ bảo vậy. Thơ ơi hiện hết đi. Phân tích quan điểm để đông lo', '2016-01-04 07:16:22', '2016-01-04 10:03:45', 1, 57, '2016-10-02 03:06:44', '2016-10-02 03:06:44'),
